  //  })
  //  .then(() => {
  //   setloaded(true);
  // });
  // },[]);

  // const runCallback=(cb)=>{
  //   return cb();
  // };

    return (
        <>


          <div className="head">
          <div className="container neon-box" style={{
            textAlign: "center",
            fontSize: "25px",
            fontFamily: "'Russo One', sans-serif",
            // color:"white"
          }}>
            <span className="flicker">TIMELINE</span>
            </div>
        </div>
        <div>
        { (props.loaded === true) ?
        <div className="figure">
                <div className="containerfigure">
                      {
                        props.level>0 && Array.apply(0,Array(parseInt(props.level))).map(function(x,i){
                          console.log("level");
                          if(parseInt (props.userlevel) === i+1){
                            return(
                              <div className={styles.activelevelContainer} key={i}>
                                <div className={styles.active}>
                                  LEVEL {i+1}
                                </div>
                              </div>
                            )
                          }else{

                          return (

                          <div className={styles.levelContainer} key={i}>
                          <div className={styles.level}>
                              LEVEL {i+1}
                              </div>
                              </div>
                              )}
                        })
                      }
                    </div>
                    <div className={styles.wrapper}>
                    {isSignedIn ? (
              <div>
                <Avatar
                  position="right"
                  alt={name}
                  src={image}
                  className={styles.ava}
                  style={{
                    textAlign: "right",

                  }}
                />
              </div>
            ) : (
                <div></div>
              )}
              &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;

          {Log && (

              <GoogleLogout
                render={(renderProps) => (
                  <div>
                    <Link href="/">
                      <Button onClick={logout} style={{
                        backgroundColor:"#4dcfe0",
                        borderRadius:"15px",
                        height: "40px", width: "100px", 
                      }}>Logout</Button>
                    </Link>
                  </div>
                )}
                onLogoutSuccess={logout}
              />

        ) }
        </div>

        </div> 
    :(<div></div>)}
    </div>


        </>

    )
}
export default Timeline
